import React from 'react';
import ReactDOM from 'react-dom';
import Nav,{Card} from "./cards";
import Arr from "./cardsarr";
ReactDOM.render(<>
    <Nav/>
    <div className="ashu">
    <Card imgsrc={Arr[0].imgsrc} link={Arr[0].link} name="Lost in space"/>
    <Card imgsrc={Arr[1].imgsrc} link={Arr[0].link} name="Stranger things"/>
    <Card imgsrc={Arr[2].imgsrc} link={Arr[0].link} name="Forever"/>
    <Card imgsrc={Arr[3].imgsrc} link={Arr[0].link} name="Forever"/>



    </div>
    </>,document.getElementById("root"));

